import React, { useState } from 'react';
import styles from './Newuser.module.css';

const Newuser = () => {
  const [successMessage, setSuccessMessage] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    setSuccessMessage('Account created successfully!');
    e.target.reset();
    axio.post("http://localhost:8080/users/save",form).then((Response)=>{
      console.log(Response.data);
      setForm(Response.data);
      
    })
  };

  return (
    <>
      <form onSubmit={handleSubmit}>
        <div className={styles.new}>
          <input type="text" name="name" id="name" placeholder="Enter your name" required />
          <input type="email" name="email" id="email" placeholder="Enter Email" required />
          <input type="tel" name="phone" id="phone" placeholder="Enter Mobile number" required />

          <div className={styles.container}>
            <select name="block" id="block" required>
              <option value="">Select Block</option>
              <option value="A">Block - A</option>
              <option value="B">Block - B</option>
              <option value="C">Block - C</option>
              <option value="D">Block - D</option>
              <option value="E">Block - E</option>
              <option value="F">Block - F</option>
            </select>

            <select name="floor" id="floor" required>
              <option value="">Select Floor</option>
              <option value="1">1st Floor</option>
              <option value="2">2nd Floor</option>
              <option value="3">3rd Floor</option>
              <option value="4">4th Floor</option>
              <option value="5">5th Floor</option>
            </select>

            <input type="number" name="doorno" id="doorno" placeholder="Enter Door Number" required />

            <button type="submit">Create Account</button>
          </div>

          {successMessage && (
            <p className={styles.success}>{successMessage}</p>
          )}
        </div>
      </form>
    </>
  );
};

export default Newuser;
